import React, {useEffect} from "react";
import "./App.css";
import WorkoutCard from "./WorkoutCard"


function WorkoutList ( { selectedAthlete, athletes, onLogSubmit, workouts, workoutLogs, onLogDelete } ) {

    const workoutsToDisplay = (array) => array.map((workout) => <WorkoutCard onLogSubmit={onLogSubmit} key={workout.id} workout={workout} athletes={athletes} workoutLogs={workoutLogs} selectedAthlete={selectedAthlete} onLogDelete={onLogDelete}/>)

    return (
        <div id="workout_list">
            {/* {workoutsToDisplay} */}
            {selectedAthlete === "All" ? workoutsToDisplay(workouts).sort(a, b => a.date.localeCompare(b.date)) : workoutsToDisplay(selectedAthlete.workouts)}
        </div>
    )
}

export default WorkoutList
